@import './css/place.css';
.mapinstall{
  width: 100%;
  height: calc(100vh - 80px);
  padding: 15px;
  background: #f0f3ff;
  overflow: hidden;
}
.map_box{
  width: calc(100% - 245px);
  height: calc(100% - 30px);
  position: absolute;
  right: 15px;
}
.map_box .map{
  width:100%;
  height: 100%;
}
.scroll_box{
  width: 200px;
  height: calc(100% - 30px);
  position:absolute;
  left: 15px;
  top: 15px;
  z-index: 10;
  overflow-x: hidden;
  padding: 0;
  margin: 0 !important;
  box-shadow:0px 0px 25px 0px rgba(63,106,255,0.08);
  border-radius:6px;
}
.titles {
  padding-top:20px;
  padding-left:30px;
  text-align: left;
  font-size:16px;
  font-family:PingFang SC;
  font-weight:500;
  color:rgba(29,33,51,1);
}
.leftdiv{
  width: 200px;
  text-align: center;
  z-index: 999;
  margin-top: -15px;
  margin-left:-40px;
}
.leftdiv .top{
  border-radius: 6px;
  width: 100%;
  height: 260px;
  margin:0;
  background: #fff;
}
.top>div:not(.titles){
  font-size:14px;
  font-family:PingFang SC;
  font-weight:500;
  color:rgba(29,33,51,1);
  margin-top: 30px;
}
.leftdiv .bottom{
  padding-left: 30px;
  background: #fff;
  border-radius: 6px;
  margin-top: 15px;
  text-align: left;
  width: 100%;
  height: calc(100% - 275px);
}
.leftdiv .bottom .titles{
  padding-left:0;
}
.bottom div:not(.titles), .bottom input{
  font-size:14px;
  font-family:PingFang SC;
  font-weight:400;
  color:rgba(29,33,51,1);
}
.bottom .el-input,.bottom .el-select{
  height: 30px;
  width: 140px;
}
.bottom .el-input,.bottom .el-select, .bottom div:not(.titles){
  margin-top:20px;
}
.bottom .el-button{
  margin-top: 20px;
}
